import React from 'react';

const Index = () => {
    return (
        <div className="flex flex-wrap items-center justify-start p-10">
            <div className="flex flex-wrap items-center justify-center sm:p-10 p-0">
                <img src="/img/pfp.png" className="rounded-full w-auto mr-4"></img>
                <h1 className="text-4xl text-white font-bold leading-none">Hello there, my name's <span className="text-indigo-500">Kyu</span> nice to meet you!</h1>
                <p className="leading-none text-lg text-white font-semibold">I'm a high-school student, full-stack developer and an aspiring entrepreneur!</p>
            </div>
        </div>
    )
}

export default Index;
